//Logged in reducer

const initialState = {
  state: 0,
};
const loggedReducer = (state = 0, action) => {
  switch (action.type) {
    case "SIGN_IN":
      return 1;
    case "LOGOUT":
      return 0;
    default:
      return state;
  }
};
export default loggedReducer;
